-- База данных: `dbGeoAssistant` 

-- CREATE DATABASE `dbGeoAssistant` CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci;

--
-- Структура таблицы храняшие информацию о аудентификации
--

CREATE TABLE `users_geo` (
  id INT AUTO_INCREMENT PRIMARY KEY,
  username VARCHAR(255) UNIQUE NOT NULL,
  password_username VARCHAR(255) NOT NULL
);

-- --------------------------------------------------------
--
-- Структура таблицы храняшие названия участков
--

-- Таблица для групп Base
CREATE TABLE base_plots (
    base_id INT AUTO_INCREMENT PRIMARY KEY,
    name_base VARCHAR(50) NOT NULL UNIQUE
);


-- Таблица для групп Poligons
CREATE TABLE poligons_plots (
    poligons_id INT AUTO_INCREMENT PRIMARY KEY,
    name_poligons VARCHAR(50) NOT NULL UNIQUE
);



-- --------------------------------------------------------
--
-- Структура таблицы храняший информацию о точках
--

CREATE TABLE points_Base_geo (
    id INT AUTO_INCREMENT PRIMARY KEY,
    point_id VARCHAR(10),         -- ID точки, например "9102"
    group_name INT NOT NULL,      -- участки: 'niv', 'trig','SOD-11'...     
    x DOUBLE,                     -- координата X
    y DOUBLE,                     -- координата Y
    vycka DOUBLE,                 -- высота
    date DATE,                    -- дата
    systemCoordinates_id INT NOT NULL,-- система координат
    positionType_id INT NOT NULL,     -- коды      
    FOREIGN KEY (group_name) REFERENCES base_plots(base_id),      
    FOREIGN KEY (systemCoordinates_id) REFERENCES codes(id),       
    FOREIGN KEY (positionType_id) REFERENCES codes(id)             
);


CREATE TABLE points_poligons_geo (
    id INT AUTO_INCREMENT PRIMARY KEY,
    point_id VARCHAR(10),         -- ID точки, например "9102"
    group_name INT NOT NULL,      -- участки: 'niv', 'trig','SOD-11'...     
    x DOUBLE,                     -- координата X
    y DOUBLE,                     -- координата Y
    vycka DOUBLE,                 -- высота
    date DATE,                    -- дата
    systemCoordinates_id INT NOT NULL,-- система координат
    positionType_id INT NOT NULL,     -- коды      
     FOREIGN KEY (group_name) REFERENCES poligons_plots(poligons_id),      
    FOREIGN KEY (systemCoordinates_id) REFERENCES codes(id),       
    FOREIGN KEY (positionType_id) REFERENCES codes(id)
);



-- --------------------------------------------------------
--
-- Структура таблицы типы кодов
--
-- 1. Типы кодов
CREATE TABLE code_types (
    id INT AUTO_INCREMENT PRIMARY KEY,
    code_key VARCHAR(50) UNIQUE NOT NULL
);


-- 2. Коды
CREATE TABLE codes (
    id INT AUTO_INCREMENT PRIMARY KEY,
    code_type_id INT NOT NULL,
    FOREIGN KEY (code_type_id) REFERENCES code_types(id)
);

-- coordinateSystem


-- positionType (18 штук)


-- 3. Переводы
CREATE TABLE code_translations (
    id INT AUTO_INCREMENT PRIMARY KEY,
    code_id INT NOT NULL,
    lang ENUM('eng', 'cz', 'ua') NOT NULL,
    value VARCHAR(100) NOT NULL,
    FOREIGN KEY (code_id) REFERENCES codes(id)
);

